create database if not exists trab2;

use trab2;

drop table if exists DadosAPP;

CREATE TABLE `DadosAPP` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `App` varchar(150) DEFAULT NULL,
  `Category` varchar(64) DEFAULT NULL,
  `Rating` DECIMAL(10,2) NOT NULL,
  `Reviews` int(11) NOT NULL,
  `Size` varchar(64) DEFAULT NULL,
  `Installs` varchar(64) DEFAULT NULL,
  `Type` varchar(64) DEFAULT NULL,
  `Price` varchar(64) DEFAULT NULL,
  `Content Rating` varchar(64) DEFAULT NULL,
  `Genres` varchar(64) DEFAULT NULL,  
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;




